import FooterLayout from "./Footer";
import contacto from '../imagenes/generales/contacto.png';
const Contactos= ()=>
{
    return(
        <div className="todo">
            <div>
                <h2>Contacto</h2>
                <img className="imagenContacto" src={contacto}/>
            </div>
            <FooterLayout></FooterLayout>
        </div>
    )
}
export default Contactos;
